using Arrowgene.Services.Buffers;
using Ddo.Server.Common;
using Ddo.Server.Packet;

namespace Ddo.Server.PacketResponses
{
    public class NewConnectionResponse : PacketResponse
    {
        public NewConnectionResponse() : base((ushort) PacketId.NewConnectionResponse)
        {
        }

        protected override IBuffer ToBuffer()
        {
            IBuffer res = BufferProvider.Provide();
            res.SetPositionStart();
            string d =
                "";
            res.WriteBytes(Util.FromHexString(d));
            return res;
        }
    }
}
